import React, { useState } from "react";
import DraftsIcon from "@mui/icons-material/Drafts";
import CalendarMonthIcon from "@mui/icons-material/CalendarMonth";
import TextSnippetIcon from "@mui/icons-material/TextSnippet";
import PermContactCalendarIcon from "@mui/icons-material/PermContactCalendar";
import WalletIcon from "@mui/icons-material/Wallet";
import ArrowDropDownIcon from "@mui/icons-material/ArrowDropDown";
import NotificationsNoneIcon from "@mui/icons-material/NotificationsNone";
import CameraAltIcon from "@mui/icons-material/CameraAlt";
import WidgetsIcon from "@mui/icons-material/Widgets";

import "./Header.css";
import { Avatar, Box, Button, Modal, Typography } from "@mui/material";
import { Link } from "react-router-dom";

function Header() {
  const style = {
    position: "absolute",
    top: "13%",
    left: "89%",
    transform: "translate(-50%, -50%)",
    width: 360,
    bgcolor: "background.paper",
    border: "1px solid #000",
    boxShadow: 2,
    pt: 2,
    pb: 3,
  };
  const [open, setOpen] = useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);
  return (
    <div className="header">
      <div className="flex items-center">
        <Link to="/" className="flex items-center">
          <span className="text-[#02C75A] pl-1 text-[25px] font-[800]">N</span>
          <div className="text-[21px] ml-[4px] font-[400]">메일</div>
        </Link>
      </div>
      <div className="iconlist items-center">
        <DraftsIcon style={{ color: "#02c75a" }} />
        <CalendarMonthIcon />
        <TextSnippetIcon />
        <PermContactCalendarIcon />
        <WalletIcon />
      </div>
      <div className="flex pl-2">
        <div className="flex my-auto items-center">
          <Avatar sx={{ width: 24, height: 24 }} />
          <button
            onClick={handleOpen}
            className="ml-2 text-[10.5px] text-black font-[200]"
          >
            sonu88
          </button>
          <ArrowDropDownIcon fontSize="1" className="my-auto mr-3" />
        </div>
        <Modal
          open={open}
          onClose={handleClose}
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            bgcolor: "background.transparent",
          }}
        >
          <Box sx={{ ...style, width: 310 }}>
            <Typography variant="h6" component="h2">
              <div className="flex items-center w-full pl-[19px]">
                <CameraAltIcon sx={{ fontSize: 17 }} />
                <Avatar sx={{ width: 45, height: 45 }} />
                <div className="">
                  <div className="flex w-full">
                    <div className="flex items-center text-[15px] font-[500]">
                      sonu88<div className="font-[300]">님</div>
                    </div>
                    <div className="text-[12px] border-[1px] text-center w-[50px]">
                      로그아웃
                    </div>
                  </div>
                  <div className="text-[14px] font-[500] text-gray-600">
                    email@email.com
                  </div>
                  <div className="text-[12px] flex items-center font-[400]">
                    <div className="px-[2px]">네이버ID</div>
                    <div className="border-l-[1px] px-[2px]">보안설정</div>
                    <div className="border-l-[1px]">내인증서</div>
                  </div>
                </div>
              </div>
            </Typography>
          </Box>
        </Modal>

        <div className="border-l-[1px] w-[7vh] items-center flex">
          <NotificationsNoneIcon className="mx-auto items-center flex " />
        </div>
        <div className="border-l-[1px] w-[7vh] items-center flex">
          <WidgetsIcon className="mx-auto items-center flex" />
        </div>
      </div>
    </div>
  );
}

export default Header;
